    "text": "Swiss knife for machine learning.(Image: Build Status) (Image: MLBase) (Image: Coveralls) (Image: Documentation Status)This package does not implement specific machine learning algorithms. Instead, it provides a collection of useful tools to support machine learning programs, including:Data manipulation & preprocessing\nScore-based classification\nPerformance evaluation (e.g. evaluating ROC)\nCross validation\nModel tuning (i.e. search best settings of parameters)Notes: This package depends on StatsBase and reexports all names therefrom."
